import base64
import numpy as np
from PIL import Image
import io

def process_image(base64_image):
    # 将 base64 编码的图像字符串转换为图像
    image = Image.open(io.BytesIO(base64.b64decode(base64_image)))
    
    # 将图像转换为 numpy 数组
    inpaint_mask = np.array(image) / 255.0

    # 创建 mask
    mask = Image.fromarray((inpaint_mask * 255).astype(np.uint8))

    # 创建 mask_gray
    mask_gray = Image.fromarray((inpaint_mask * 127).astype(np.uint8))

    return mask, mask_gray

if __name__ == '__main__':
    base64_image = ""
    mask, mask_gray = process_image(base64_image)
    mask.save("./mask_image.png")
    mask_gray.save("./mask_gray_image.png")